import { Styled } from '@emotion/core'


const Index = (props) => {

    const bag = Styled.div`
        background:black;
        color:red;
    `
    return (
            <bag>
                <h1>
                    Hello, stack
                </h1>
            </bag>

    );
}

export default Index;
